  [],\n\t\"revision_timestamp\": \"2015-09-27T02:06:37.229971\",\n\t\"name\": \"sensitivity-of-coastal-environments-and-wildlife-to-spilled-oil-florida-panhandle-nests-nest-po\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This data set contains sensitive biological
  resource data for wading birds, shorebirds, raptors, diving birds, and gulls and
  terns in for the Florida Panhandle. Vector points in this data set represent bird
  nesting and wintering sites. Species-specific abundance, seasonality, status, life
  history, and source information are stored in relational data tables (described
  below) designed to be used in conjunction with this spatial data layer. This data
  set comprises a portion of the ESI data for the Florida Panhandle. ESI data characterize
  the marine and coastal environments and wildlife by their sensitivity to spilled
  oil. The ESI data include information for three main components: shoreline habitats,
  sensitive biological resources, and human-use resources. See also the BIRDS data
  layer, part of the larger Florida Panhandle ESI database, for additional bird information.\",\n\t\"license_title\":
